import React from 'react';
import './Home.css';
import LocalShippingIcon from '@mui/icons-material/LocalShipping';
import AddModeratorIcon from '@mui/icons-material/AddModerator';
import HighQualityIcon from '@mui/icons-material/HighQuality';
import Carousel from './Carousel';
import Cards from './Cards';
import data from './db.json';
import NewsPanel from './NewsPanel';
import CustomerFeedback from './CustomerFeedback';


function Home() {
  return (
    <div>
      <Carousel />
      <Cards items={data.items} />
      <img className="ad" src="data:image/jpeg;base64," alt="laptop"/>
      <div className="speciality">
      <div className='special'>
      <LocalShippingIcon/>
        <p className="special-title">Free Delivery</p>
        <p>on order above $50.00</p>
      </div>
      <div className='special'>
      <HighQualityIcon/>
        <p className="special-title">Best Quality</p>
        <p>best quality in price</p>
      </div>
      <div className='special'>
      <AddModeratorIcon/>
        <p className="special-title">1 year warranty</p>
        <p>Available warranty</p>
      </div>
      </div>
      <CustomerFeedback/>
     <div className='sponsor'>

     </div>
      <NewsPanel/>
    </div>
  );
}

export default Home;
